import base64
import zlib
import sys


ENCRYPTED_CODE = ""

try:
    
    compressed_code = base64.b64decode(ENCRYPTED_CODE.encode('utf-8'))
    original_code = zlib.decompress(compressed_code).decode('utf-8')
    
    
    exec(original_code, {'__name__': '__main__'})
except Exception as e:
    print(f"Error executing encrypted code: {e}")
    sys.exit(1)
